import { BrowserRouter, Routes, Route } from "react-router-dom";
import Layout from "./pages/Layout";
import About from "./pages/About";
import Ecosystem from "./pages/Ecosystem";
import Gallery from "./pages/Gallery";
import SiteMap from "./pages/SiteMap";
import Contact from "./pages/Contact";
import Home from "./pages/Home";
import One from "./pages/One";
import Two from "./pages/Two";
import NoPage from "./pages/NoPage";

{/* 
  
  Purpose: component demonstrates the react-router-dom 
  Author(s): Terry Goldsmith
*/}

export default function MyPages() {
  return (
    <BrowserRouter>                               {/* uses the browser built in path history */}
      <Routes>                                    {/* container for each Route */}
        <Route path="/" element={<Layout />}>     {/* each nested Route has "/" prefixed to it */}
          <Route index element={<About />} />      {/* a Route ties a path to a component - index is top level */}
          <Route path="gallery" element={<Gallery />} />  {/* path "/one" tied to component One */}
          <Route path="ecosystem" element={<Ecosystem />} />  {/* path "/one" tied to component One */}
          <Route path="sitemap" element={<SiteMap />} />  {/* path "/two" tied to component Two */}
          <Route path="contact" element={<Contact />} />  {/* path "/two" tied to component Two */}
          <Route path="*" element={<NoPage />} /> {/* "/*" implies all other paths tied to NoPage */}
        </Route>
      </Routes>
    </BrowserRouter>
  );
}
